$( document ).ready(function() {
  initMap(-3.337954, 116.596456,'opt');
	$('select').select2();
  filterArea();
  filterOwnership();
  // getData();

  $('#province').on('change',function(){
    province = $(this).val();
    city = '';
    filterArea();
  });

	$('#fromDate').datepicker({
		orientation: "top auto",
		autoclose: true,
	}).on("changeDate", function(selected){
		var minDate = new Date(selected.date.valueOf());
		$('#toDate').datepicker('setStartDate', minDate);
	});

	$('#toDate').datepicker({
		orientation: "top auto",
		autoclose: true,
	}).on("changeDate", function(selected){
		var maxDate = new Date(selected.date.valueOf());
		$('#fromDate').datepicker('setEndDate', maxDate);
	});

  $('#search').on('click',function(){
    province = $("#province").val();
    city = $("#city").val();
    fromDate = $("#fromDate").val();
    toDate = $("#toDate").val();
    ownership = $("#ownership").val();
    getData();
    filterPolygon();
  });

  $('#genPam').click(function() {
    filterPolygon('genPam');
  })

  $('#searchOoh').click(function() {
    fillTable('', oohjkt);
  })

  $('#searchPoi').click(function() {
    fillPoi(poijkt);
  })

  var updateOutput = function(e) {
    var list   = e.length ? e : $(e.target),
      output = list.data('output');
    if (window.JSON) {
      output.val(window.JSON.stringify(list.nestable('serialize')));//, null, 2));
    } else {
      output.val('JSON browser support required for this demo.');
    }
  };
  $('#nestable').nestable({group: 1}).on('change', updateOutput);
  updateOutput($('#nestable').data('output', $('#nestable-output')));
  $('#nestable_poi').nestable({group: 1}).on('change', updateOutput);
  updateOutput($('#nestable_poi').data('output', $('#nestable_poi-output')));
  $('#nestable_ooh').nestable({group: 1}).on('change', updateOutput);
  updateOutput($('#nestable_ooh').data('output', $('#nestable_ooh-output')));

});


function getData() {
  $.ajax({
    url: APIURL + "optimization?province="+province+"&city="+city+"&from="+fromDate+"&to="+toDate+"&ownership="+ownership,
    headers: {
      "token": token_type + " " + token
    },
    type: "GET",
    contentType: "application/json",
    dataType: 'json',
    processData: false,
    cache: false,
    timeout: 600000,
    success:function(data, textStatus, jqXHR) {
      if(typeof data != 'object'){ data = $.parseJSON(data); }
      setData(data)
    },
    error: function(jqXHR, textStatus, errorThrown) {
      errorHandler(jqXHR);
    }
  });
}

function setData(data) {
  var ooh_site = data.data.ooh_site;
  var total_site = data.data.total_site;
  var datane1 = [];
  var datane2 = [];
  var pointdata = [];
  var total_reach = total_population = total_ooh_id = total_price = 0;
  $.each(ooh_site, function(k,v){
    perdata1 = {
      "district": v['dis_name'],
      "type": v['ooh_format'],
      "size": v['long'] + " X " + v['wide'],
      "reach": numberToMoney(v['reach']) ,
      "print": '<button type="button" class="btn btn-success right" onclick="printOoh('+v['ooh_id']+')" data-toggle="modal" data-target=".ooh-print-modal">Print</button>'
    }
    datane1.push(perdata1);
  });
  setTableContent1(datane1);

  $.each(total_site, function(k,v){
    population = Math.floor(Math.random() * (20 - 10) ) + 10
    perdata2 = {
      "district": v['dis_name'],
      "reach": numberToMoney(v['reach']),
      "population": numberToMoney(population),
      "ooh_id": v['ooh_id'],
      "price": numberToMoney(v['price'])
    }
    datane2.push(perdata2);
    total_reach += v['reach']
    total_population += population
    total_ooh_id += v['ooh_id']
    total_price += v['price']
  });
  total = {
    "district": "<b>TOTAL</b>",
    "reach": "<b>" + numberToMoney(total_reach) + "</b>",
    "population": "<b>" + numberToMoney(total_population) + "</b>",
    "ooh_id": "<b>" + total_ooh_id + "</b>",
    "price": "<b>" + numberToMoney(total_price) + "</b>"
  }
  datane2.push(total);
  setTableContent2(datane2);

}

function filterPolygon(e) {
  if (e=='genPam') {
    data = arearecommendationjkt
  } else if (e=='searchOoh') {
    data = arearecommendationjkt
  } else if (e=='searchPoi') {
    data = poijkt
  } else if (province==31 && city==3174) {
    data = jakbar
  } else if (province==31 && city==3173) {
    data = jakpus
  } else if (province==31 && city==3171) {
    data = jaksel
  } else if (province==31 && city==3172) {
    data = jaktim
  } else if (province==31 && city==3175) {
    data = jakut
  } else {
    data = jkt
  }
  create_polygon(data.data.polygon);
}

